script: |
  super -f tsv -I q730.sql | sort > q730.out

vector: true

inputs:
  - name: q730.sql
    data: |
      SELECT + col1 AS col0 FROM tab1 WHERE NOT col0 * col0 * - col2 IN ( + tab1.col2 + - col2 * col0 + - col1 );
  - name: tab1

outputs:
  - name: q730.out
    data: |
      10
      13
      26
